import "./Navbar.css"
const Navbar = () => {
  return (
    <nav className="nav">
      <div>
        <a href="/profile">Profile</a>
      </div>
      <div>
        <a>Messages</a>
      </div>
      <div>
        <a href="/feed">Feed</a>
      </div>
      <div>
        <a href="/music">Music</a>
      </div>
      <div>
        <a href="/settings">Settings</a>
      </div>
    </nav>
  );
};

export default Navbar;
